let button = document.getElementsByClassName('btn1')[0]
let wordContainer = document.getElementsByClassName('wordArea')[0]


let wordAddToContainer = () => {
    let noOfWords = parseInt(document.getElementById('noOfWords').value)
    let sizeOfWords = parseInt(document.getElementById('no.OfWords').value)
    let frequenc=document.getElementById("wordFrequency").value
    let first = document.getElementById('first').value
    let last = document.getElementById('last').value


    let wordFilter=(a)=>{

        if (frequenc == 'equals'){
            return a.length==sizeOfWords && (first==a[0]  || last==a[-1])}

        else if (frequenc == 'less_than'){
            return a.length<=sizeOfWords && (first==a[0]  || last==a[-1])
        }
        else{
            return a.length >= sizeOfWords && (first==a[0]  || last==a[-1])
        }
    }


    let wordContainer = document.getElementsByClassName('wordArea')[0]
    let i = 0



let addWords =()=>{
    while (i < noOfWords) {
        let noOfWords= words.filter(wordFilter)

        let random = Math.floor((Math.random() * noOfWords.length))
        const button = document.createElement("button")
        button.innerHTML = noOfWords[random]
        button.setAttribute('class', 'btn2')
        button.setAttribute('id', 'buttonID' + i)
        wordContainer.append(button)
        i++
    }
}


    if (wordContainer.querySelectorAll('button').length == 0) {
       addWords()
    }

    else {
        wordContainer.innerHTML = ''
        addWords()
    }




    for (let j = 0; j < noOfWords; j++) {

    const new2 = () => {
        let removedWord=document.getElementById('buttonID' + j)
        wordContainer.removeChild(removedWord)
        mylist=document.getElementsByClassName('wishList')[0]
        
        mylist.append(removedWord)
        
        
        
    }
    wordContainer.querySelectorAll('button')[j].addEventListener('click', new2)}
}


button.addEventListener('click', wordAddToContainer)




